(10, 'ஜிகர்தண்டா 2', 1, 'd0c33.jpg', 'குறும்படம் இயக்கி விட்டு சினிமா இயக்க வந்தவர்களை குறும்பட இயக்குனர்கள் என்று அழைத்ததாலோ என்னமோ இயக்குனர் கார்த்திக் சுப்புராஜ், அவர் பட வசனத்தின் படியே சொல்வதென்றால் ஒரு பெரும்.....படத்தை இயக்கியிருக்கிறார். இதுவரை சினிமாவில் குடும்பக் கதைகளைப் பார்த்திருக்கிறோம், காதல் கதைகளைப் பார்த்திருக்கிறோம், ஆக்ஷன் கதைகளைப் பார்த்திருக்கிறோம், காமெடி கதைகளைப் பார்த்திருக்கிறோம். ஆனால், முதல் முறையாக ஒரு ஆக்ஷன் பிளஸ் காமெடி கதையை இப்போதுதான் பார்க்கிறோம். அது என்ன ஆக்ஷன் பிளஸ் காமெடி கதை என்கிறீர்களா. முதல் பாதி பக்கா ஆக்ஷன் கதை, இரண்டாவது பாதி காமெடி கதை.\r\n\r\nதமிழ் சினிமாவைப் பொறுத்தவரை ஒரு சென்டிமென்ட் உண்டு. சினிமாவுக்குள் சினிமா என்பது இதுவரை எடுபடாமல் போன ஒன்று. பாரதிராஜா முதல் பலரும் தொட்டுவிட்ட கதைக்களம், ஆனால் யாருக்கும் ராசியாக அமையவில்லை. ஒருவேளை அந்த ராசியை உடைத்தெறியலாம் என இந்தப் படத்தின் இயக்குனர் முயன்றிருக்கிறாரோ என்னமோ? வித்தியாசமாக படம் பண்ண வேண்டியதுதான், அதற்காக முதல் பாதியை ஆக்ஷனின் உச்சத்திற்கு கொண்டு போய்விட்டு, அப்படியே அதற்கு எதிராக இரண்டாவது பாதி கதையை அமைப்பதா என்ற கேள்வி எழாமல் இல்லை. ஒருவேளை முதல் பாதி கதை எழுதி முடித்ததும் பவர் ஸ்டார் படம் எதையாவது பார்த்திருப்பாரோ? அதன் பாதிப்புதான் டெரர் ஆக இருந்த முதல்பாதியை பின்னர் டெரர் ஸ்டார் காமெடி ஆன மாற்றியிருக்கிறார். எங்கே நமது படத்தையும் கொரிய படத்தின் காப்பி படம் மற்றவர்கள் சொல்வதற்கு முன் நாமே சொல்லிவிடுவோம் என அதற்கும் படத்தில் ஒரு காட்சியை வைத்துவிட்டார்.\r\n\r\nஒரு தொலைக்காட்சியின் குறும்படப் போட்டியில் நடுவர்களுக்கு இடையே நடக்கும் சண்டையில், அந்த போட்டியில் கலந்து கொண்ட சித்தார்த்துக்கு நடுவர்களில் ஒருவரான ஒரு தயாரிப்பாளர் படம் இயக்க வாய்ப்புத் தருகிறேன் எனக் கூறி விடுகிறார். அவர் சித்தார்த்திடம் ரத்தம் தெறிக்கிற மாதிரி ஒரு ஆக்ஷன் படத்துக்கு கதை எழுதிட்டு வாங்க படம் இயக்கலாம் என்கிறார். ஒரு நிஜ ரவுடியின் வாழ்க்கைக் கதையை எழுத முடிவெடுத்து மதுரைக்குப் புறப்படுகிறார் சித்தார்த். அங்கு நண்பன் கருணாகரன் உதவியுடன், மதுரையை ஆட்டிப் படைக்கும் ரவுடி சிம்ஹாவின் வாழ்க்கை எப்படிப்பட்டது என்பதை ஆராய்ந்து கதையை உருவாக்க ஆரம்பிக்கிறார்.\r\n\r\nசிம்ஹாவை என்கெளன்ட்ர் செய்ய காவல்துறையும் முடிவெடுத்திருக்க, சிம்ஹாவின் போட்டியாளர்களும் அவரைக் கொலை செய்ய துடித்துக் கொண்டிருக்க, அந்த சூழ்நிலையில் சித்தார்த்தும், கருணாகரனும் சிம்ஹாவிடம் வசமாக சிக்கிக் கொள்கிறார்கள். அவர்களை உளவு பார்க்க வந்தவர்கள் என சிம்ஹா நினைத்து போட்டுத் தள்ள முடிவெடுக்கிறார் இதன் பின் என்ன என்பதுதான் படத்தின் கலகலப்பான (?) மீதி கதை.\r\n\r\nஎன்ன இது ஒரு பக்கா ஆக்ஷன் கமர்ஷியல் படத்துக்குரிய கதையை சொல்லிட்டு, இதன் பின் நடப்பது கலகலப்பான கதை என்று சொல்லியிருக்கிறோமே என ஆச்சரியப்பட வேண்டாம். இடைவேளைக்குப் பின் ஆக்ஷன் டிராக்கை விட கதை வேறு தடத்தில் பயணிக்கிறது. நான் வெஜிடேரியன் ஹோட்டலுக்குப் போய் விட்டு தயிர் சாதம் வாங்கி சாப்பிட்டால் எப்படி இருக்குமோ அப்படி இருக்கிறது நிலைமை...\r\n\r\nபடத்துல ஹீரோ சித்தார்த்தா அல்லது சிம்ஹாவான்னு படம் பார்க்கிற நமக்கு மட்டுமில்லாம, எல்லாருக்குமே ஒரு குழப்பம் வரும். சித்தார்த்தை விட சிம்ஹாக்குதான் படத்துல காட்சிகள் அதிகமா இருக்கும் போல. சும்மா சொல்லக் கூடாது சிம்ஹா புகுந்து விளையாடியிருக்கிறார். அசால்ட் சேது வாக அட்டகாசமாக நடித்திருக்கிறார். அந்த கதாபாத்திரத்திற்காக உருவாக்கப்பட்டுள்ள தோற்றத்தில் அப்படியே பொருந்திப் போகிறார். பொதுவா, நம்மைக் கவர்ந்த ஒரு கதாபாத்திரத்தில் வேறு நடிகர்கள் நடித்திருந்தால் எப்படியிருக்கும் என்று கற்பனை செய்து பார்ப்போம். ஆனால், இந்த சேது கதாபாத்திரத்தைப் பொறுத்தவரையில் வேறு யாரையும் கற்பனையில் கூட கொண்டு வரமுடியவில்லை. நின்று, நிதானமாக நெத்தி அடி அடித்திருக்கிறார். இந்தப் படம் சிம்ஹாவை வேறு ஒரு உயரத்தில் கொண்டு போய் உட்கார வைத்துவிடும்.\r\n\r\nதிரைப்படம் இயக்கும் ஆசையில் கதை எழுதுவதற்காக சென்னையிலிருந்து மதுரைக்கு வரும் இயக்குனர் கதாபாத்திரத்தில் சித்தார்த். கொஞ்சம் அப்பாவித்தனமான கதாபாத்திரம், எதையுமே யோசித்து யோசித்து செய்கிறார். லட்சுமி மேனனிடம் காதலிலாவது ஜொலிப்பார் என்று பார்த்தால் அங்கும் ஒன்றுமில்லை, சிம்ஹாவிடம் கொஞ்சம் முறைத்துக் கொண்டாவது நிற்பார் என்று பார்த்தால் அங்கும் ஒன்றுமில்லை. இயக்குனர் கார்த்திக், சித்தார்த்திடம் கதாபாத்திரத்தை சரியாக சொல்லவில்லையா, அல்லது சித்தார்த், நமக்கு இருக்கும் முக்கியத்துவத்திற்கு இது போதும் என்று முடிவெடுத்துவிட்டாரா என்பது தெரியவில்லை. திறமையைக் கொட்டி நடிப்பதற்கு காட்சிகள் இல்லை என்பது ஒரு பக்கம் இருந்தாலும், சிம்ஹா கதாபாத்திரம் ஸ்டிராங்காக உருவாக்கப்பட்டு விட்டதால், சித்தார்த்தின் கதாபாத்திரம் எடுபடாமல் போய்விட்டது.\r\n\r\nலட்சுமி மேனன் மொத்தமாக எத்தனை காட்சிகள் வந்தார் என்பதை விரல் விட்டு எண்ணி விடலாம். தொடர்ச்சியாக வெற்றிப் படங்களில் நடித்து வரும் ஒரு முன்னணி நாயகிக்கு இந்த அளவிற்கா குறைவான காட்சிகளை வைப்பது ?. படத்துக்குத் தேவையில்லை என்று நினைத்திருந்தால் மொத்தமாக அவரது கதாபாத்திரத்தைக் கூட வைக்காமல் போயிருக்கலாம். ஆனாலும், ஒரே ஒரு ட்விஸ்ட்டுக்கு மட்டும் அவரது கதாபாத்திரம் பயன்பட்டிருக்கிறது.', 0, '2015-03-10 00:00:00', '2015-03-09 12:45:35'),
(11, 'அஞ்சான்', 1, 'E4zE3x_VM_123136000000.jpg', 'இயக்குநர் லிங்குசாமியின் எழுத்து, இயக்கத்தில் ''சிங்கம்'' சூர்யா நடித்து, எக்கச்சக்க எதிர்பார்ப்புகளுடன் திரைக்கு வந்திருக்கும் படம் தான் ''''அஞ்சான்''''. இது யாருக்கும் அஞ்சாத சிங்கமா.? சூர்யாவின் வெற்றி பட வரிசையில் சொக்கத் தங்கமா.? என்பதை இனி இங்கு உரசிப்பார்ப்போம்...!\r\n\r\nகதைப்படி, மும்பையில் தாதாவாக திகழ்ந்து, தகவலே இல்லாமல் போன தன் அண்ணன் சூர்யாவை தேடி கன்னியாகுமரியில் இருந்து மும்பைக்கு இரயிலேறுகிறார் மாற்று திறனாளி தம்பி சூர்யா. மும்பை இரயில்வே ஸ்டேஷன் போய் இறங்கியதும், அந்தேரி ஏரியாவுக்கு அண்ணன் சூர்யாவைத் தேடி டாக்ஸி பிடிக்கும் தம்பி சூர்யாவை, வாங்க அந்தேரி என வரவேற்கும் டாக்ஸி டிரைவர் காமெடி சூரியை கூடவே கூட்டிக் கொண்டு வழக்கமான தமிழ் சினிமா பாணியில் அண்ணனைத் தேடாமல், தனி ஆளாக அண்ணன் சூர்யாவை தேடுகிறார் தம்பி சூர்யா.\r\n\r\nஒரு கட்டத்தில் அண்ணன், தம்பி இருவர் அல்ல... இருவரும் ஒருவர்தான், ஒரே சூர்யா தான் எனும் உண்மை உலகுக்கும் (மும்பை நிழல் உலகுக்கும்...) உங்களுக்கும் (ரசிகர்களுக்கும்...) தெரிய வரும்போது ''அஞ்சான்'' பதினாறடி பாஞ்சானாக விறுவிறுப்பு பிடிக்கிறது. அப்புறம், தம்பி சூர்யா, அண்ணன் சூர்யாவை தேடி வரவில்லை, தம்பி சூர்யா என்று ஒருவரே இல்லை... தன் நண்பன் சந்துரு-வித்யூத் ஜம்வாலை நயவஞ்சமாக சுட்டுக் கொன்றவர்களையும், தன்னை சுட்டு ஆற்றுக்குள் தள்ளிய விரோதிகளையும், அவர்களுக்கு உதவிய துரோகிகளையும் தேடித்தான் அண்ணன் ராஜூ பாய் சூர்யாவே, தம்பி கிருஷ்ணன் சூர்யாவாக அவதாரமெடுத்திருக்கிறார்... எனும் கதையையும், அது பயணிக்கும் தடத்தையும் முன்கூட்டியே யூகிக்க முடியாதவர்களுக்கு, படம் பயங்கர பரபரப்பாக, பரபரப்பு பயங்கரமாக, விறுவிறுப்பாக இருக்கிறது. அதை யூகிக்க முடிந்த இந்த காலத்து கில்லாடி ரசிகர்களுக்கு சற்றே ''சப்''பென்று இருக்கிறது.\r\n\r\nஅதிலும் ''சூப்பர் ஸ்டார்'' ரஜினியின் ''பாட்ஷா'', ''தளபதி'' படங்களை பலமுறை பார்த்தவர்களுக்கு இயக்குநர் லிங்குசாமி ''அஞ்சான்'' கதை பண்ணிய கதையும், ''சிங்கம் ஸ்டார்'' சூர்யாவை,,''சூப்பர் ஸ்டாராக காட்ட முயலும் கலையும் சற்று கூடுதலாகவும் யூகிக்க முடிகிறது, தெரிகிறது. ஆனால் அதை போரடிக்காமல் சின்ன, சின்ன நகாசு வேலைகளை செய்து நகர்த்தியிருப்பதால் ''அஞ்சான்'', நோஞ்சானாக தெரியாமல் பாஞ்சானாக பளிச்சிடுகி்றான்.\r\n\r\nசூர்யா வழக்கம் போலவே அண்ணன் ராஜூபாயாகவும், தம்பி கிருஷ்ணாவாகவும் இருவேறு ''கெட்-அப்''புகளில்(கவனிக்கவும், அண்ணன் டபுள்-ஆக்டில் டூயட் ரோலில் அல்ல...) பிச்சி பெடலெடுத்திருக்கிறார். ''''நான் சாகணும்னாலும் நான் தான் முடிவு பண்ணனும்... நீ சாகணும்னாலும் அதையும் நான்தாண்டா முடிவு பண்ணனும்'''' என சூர்யா துரோகிகளையும், விரோதிகளையும் சுட்டு தள்ளும் இடங்களாகட்டும், ''''சுடணும்னா சுடணும் அதை விட்டு விட்டு சும்மா பேசிட்டு இருக்கக்கூடாது...'' என எதிராளிகளை போட்டு தள்ளும் இடங்களிலாகட்டும், இன்னும் க்ளைமாக்ஸில் மெயின் வில்லன் இம்ரானை தீர்த்துகட்ட தனக்கு உதவிடும் வில்லனின் கூட்டாளிகள் மூவரை சுட்டுத்தள்ளிவிட்டு ''''எதிரியிடம் கூட துரோகிகள் இருக்கக்கூடாது...'' என ''பன்ச்'' டயலாக் அடிப்பதிலாகட்டும் சூர்யா, சூரியனாக ஜொலிக்கிறார்!\r\n\r\nஆனால் அப்புறம் விஜய்யை ''இமிடேட்'' செய்ய வேண்டும் எனும் எண்ணமும், ''''சின்னதா வேட்டு சத்தம் கேட்டதும் பயந்து பறக்குறதுக்கு நான் என்ன புறாவா.? நின்னு நிதானமா இரையை தூக்கிட்டு போற கழுகுடா...'''' என பேசும் வசனத்தில் புறாவா? சுறாவா? என புரியாமல் சூர்யா ரசிகர்கள், தியேட்டரில் விஜய்க்கு ''பன்ச்'' வைத்ததாக நினைத்து விசில் பறக்க விடுவதும், வில்லன் இம்ரானை மற்றொரு நடிகர் விக்ரம் சாயலில் பிடித்து போட்டு படங்கள் மூலம் ஏதேதோ மெஸேஜ் சொல்ல களம் இறங்கிவிட்டது புரிகிறது. போகட்டும்! படம் பேசட்டும்!\r\n\r\nநாயகி சமந்தா போலீஸ் கமிஷனர் மகளாக ''கிக்'' என்ட்ரி கொடுத்து, ரசிகர்களின் இதயங்களை ''பக் பக்'' என அடிக்க விடுகிறார். வழக்கம் போலவே ஆக்ஷ்ன் படங்களில் கதாநாயகிக்கான உரிய முக்கியத்துவம் அம்மணிக்கும் தரப்பட்டிருந்தாலும், அம்மணி சமந்தாவை காட்டிலும் சக்கை போடு போட்டிருக்கின்றனர் பார்ட்டிகளில் ஆடும் பஞ்சுமிட்டாய் பெண்கள். பலே, பலே!\r\n\r\nகாமெடி சூரி, தெலுங்கு பிரம்மானந்தம், சூர்யாவுக்கு உதவும் டிராவல்ஸ் இஸ்லாமியர் ஜோமல்லூரி மற்றும் சூர்யாவின் நண்பர், தாதாவாக வரும் சந்துரு-வித்யூத் ஜம்வால், வில்லன்கள், விரோதிகள், துரோகிகள் எல்லோரும் பாத்திரமறிந்து பளிச்சிட்டிருக்கின்றனர்.\r\n\r\nயுவனின் இசையில், ''ஏக் தோ தீன் சார் ஒத்துக்கடி...'' எனத் தொடங்கித் தொடரும் பாடல் மட்டும் மீண்டும் மீண்டும் கேட்கத்தூண்டும் ர(ரா)கம்! சந்தோஷ் சிவனின் ஒளிப்பதிவு அஞ்சானின் கூடுதல் பலம்! பிருந்தாசாரதியின் வசன வரிகள் பெரும்பலம்!\r\n\r\nராஜூபாய் சூர்யாதான் என்னை பார்க்க கூடாது, நான் அவரை பார்ப்பதில் என்ன தவறு என சூர்யாவுக்கு உதவும் ஜோமல்லூரி பாய் வீட்டில், சமந்தா பர்தாக்குள் பவனி வருவது டைரக்டர் லிங்குசாமியின் புத்திசாலித்தனத்திற்கு உதாரணம். அதேநேரம், சமந்தா, தாதா சூர்யாவை காதலிப்பதை கமிஷனர் அப்பா கண்டு கொள்ளாததும்., சமந்தா, காதலர் சூர்யாவின் பெயரை ராஜூ என கையில் பச்சைக் குத்திக்கொள்ளாமல் எல்லோரும் சூர்யாவை பயபக்தியுடனும், பாசத்துடனும் அழைப்பது போல் ராஜூ பாய் என்றே பச்சை குத்தியிருப்பதும் அபத்தம்! அதிலும் அந்த பச்சை ஸ்கெட்ச் பேனாவால் குத்தப்பட்ட பச்சை என்பது அப்பட்டமாக தெரிவது கூடுதல் அபத்தம்!\r\n\r\nஇதுமாதிரி ஒரு சில அபத்தங்களை ஒதுக்கிவிட்டால் இரண்டு மணிநேரம் 51 நிமிட படமும் சற்றே சுருங்கும். ஒருசில இடங்களில் போரடித்து கொஞ்சமே கொஞ்சம் நோஞ்சானாக தெரியும் அஞ்சானும் முழுக்க முழுக்க 64 அடி பாஞ்சானாக பளிச்சிடுவான்.\r\n\r\nமொத்தத்தில், ''''அஞ்சான்'''' - ''சற்றே சாஞ்சான்'' - ''ஆனாலும் பாய்ந்தான் - பாய்ந்துள்ளான்!!''', 0, '2015-03-09 04:00:00', '2015-03-09 12:45:37'),
(12, 'Kathai Thiraikathai', 1, '', 'Radhakrishnan Parthiban and his films can sometimes come across as oversmart, and being quirky just for the sake of being so. But in Kathai Thiraikathai Vasanam Iyakkam, this oversmartness and quirkiness lend freshness to a regular one-line plot. The film proudly wears these two elements on its sleeves and feels fresh and zany. \r\n-----------------------------------\r\nThe film begins with four seemingly disconnected events, each one more outrageous than the other — one shows a tsunami wiping away the population, another has a musician caught in a conflict, while the last one has Brahma packing off babies to the Earth. Even as we scratch our heads, we are shown that these are all ideas part of a story discussion involving the film''s protagonists, who are trying to come up with a story for a movie. \r\n\r\nThamizh, the aspiring director, is idealistic and wants to come up with a story that is interesting in every scene. His associates include passionate youngsters as well as an industry veteran who has failed to make a movie for a long time. Tamizh is married and his lover-wife Daksha is "eccentric" (the film calls her so). Daksha wants to see Tamizh as a filmmaker but at the same time, she is also wary of reality of daily life. Will Tamizh and his team be able to find a story and script? \r\n\r\nThe film is basically a witty commentary on the film industry and in this, it is quite similar to the recent Jigarthanda, which was also a film on the film industry dressed up as a gangster movie. Here too, you get the veteran breaking into a monologue on the disappointment that this glamorous industry offers to those who strive to make a mark. There is also a film being made within the film, and unlike Jigarthanda, here, we are given a fair inkling of what kind of film it is. \r\n\r\nThere is a lot of Parthiban-isms in the film (in fact, every character converses in Parthiban-speak, but this doesn''t tire you out and in fact, most of them bring a smile. The director himself appears on screen quite a bit — sometimes to steer the story, sometimes to let us in on a later development and sometimes just to keep the film wacky. \r\n\r\nThe film moves forward and backward, sideways and at times even nowhere but the writing is quite good that we are always clear where it stands. Even when it is aimlessly chugging along, you feel that the movie is going somewhere. It is a proof of the confident writing that even though the stories in the film aren''t resolved the film feels complete when it ends.', 0, '2015-03-09 00:00:00', '2015-03-09 12:45:41'),
(17, 'Manikandan Thangaraj', 1, 'e50f9.jpg', 'குறும்படம் இயக்கி விட்டு சினிமா இயக்க வந்தவர்களை குறும்பட இயக்குனர்கள் என்று அழைத்ததாலோ என்னமோ இயக்குனர் கார்த்திக் சுப்புராஜ், அவர் பட வசனத்தின் படியே சொல்வதென்றால் ஒரு பெரும்.....படத்தை இயக்கியிருக்கிறார். இதுவரை சினிமாவில் குடும்பக் கதைகளைப் பார்த்திருக்கிறோம், காதல் கதைகளைப் பார்த்திருக்கிறோம், ஆக்ஷன் கதைகளைப் பார்த்திருக்கிறோம், காமெடி கதைகளைப் பார்த்திருக்கிறோம். ஆனால், முதல் முறையாக ஒரு ஆக்ஷன் பிளஸ் காமெடி கதையை இப்போதுதான் பார்க்கிறோம். அது என்ன ஆக்ஷன் பிளஸ் காமெடி கதை என்கிறீர்களா. முதல் பாதி பக்கா ஆக்ஷன் கதை, இரண்டாவது பாதி காமெடி கதை. தமிழ் சினிமாவைப் பொறுத்தவரை ஒரு சென்டிமென்ட் உண்டு. சினிமாவுக்குள் சினிமா என்பது இதுவரை எடுபடாமல் போன ஒன்று. பாரதிராஜா முதல் பலரும் தொட்டுவிட்ட கதைக்களம், ஆனால் யாருக்கும் ராசியாக அமையவில்லை. ஒருவேளை அந்த ராசியை உடைத்தெறியலாம் என இந்தப் படத்தின் இயக்குனர் முயன்றிருக்கிறாரோ என்னமோ? வித்தியாசமாக படம் பண்ண வேண்டியதுதான், அதற்காக முதல் பாதியை ஆக்ஷனின் உச்சத்திற்கு கொண்டு போய்விட்டு, அப்படியே அதற்கு எதிராக குறும்படம் இயக்கி விட்டு சினிமா இயக்க வந்தவர்களை குறும்பட இயக்குனர்கள் என்று அழைத்ததாலோ என்னமோ இயக்குனர் கார்த்திக் சுப்புராஜ், அவர் பட வசனத்தின் படியே சொல்வதென்றால் ஒரு பெரும்.....படத்தை இயக்கியிருக்கிறார். இதுவரை சினிமாவில் குடும்பக் கதைகளைப் பார்த்திருக்கிறோம், காதல் கதைகளைப் பார்த்திருக்கிறோம், ஆக்ஷன் கதைகளைப் பார்த்திருக்கிறோம், காமெடி கதைகளைப் பார்த்திருக்கிறோம். ஆனால், முதல் முறையாக ஒரு ஆக்ஷன் பிளஸ் காமெடி கதையை இப்போதுதான் பார்க்கிறோம். அது என்ன ஆக்ஷன் பிளஸ் காமெடி கதை என்கிறீர்களா. முதல் பாதி பக்கா ஆக்ஷன் கதை, இரண்டாவது பாதி காமெடி கதை. தமிழ் சினிமாவைப் பொறுத்தவரை ஒரு சென்டிமென்ட் உண்டு. சினிமாவுக்குள் சினிமா என்பது இதுவரை எடுபடாமல் போன ஒன்று. பாரதிராஜா முதல் பலரும் தொட்டுவிட்ட கதைக்களம், ஆனால் யாருக்கும் ராசியாக அமையவில்லை. ஒருவேளை அந்த ராசியை உடைத்தெறியலாம் என இந்தப் படத்தின் இயக்குனர் முயன்றிருக்கிறாரோ என்னமோ? வித்தியாசமாக படம் பண்ண வேண்டியதுதான், அதற்காக முதல் பாதியை ஆக்ஷனின் உச்சத்திற்கு கொண்டு போய்விட்டு, அப்படியே அதற்கு எதிராக குறும்படம் இயக்கி விட்டு சினிமா இயக்க வந